import styled from 'styled-components'

export const HeaderStyle = styled.div`
    .header {
        width: 100%;
        height: 100px;
        background: #1E212A;
    }

    h1 {
        margin: 0;
        color: #ffff;
        font-size: 50px;

    }

    span {
        color: #00FF7F;
    }
`
